import logoImg from "../image/logo.png";
import "./main-style.css";

export default function Main() {
  return (
    <div className="circle">
      <img src={logoImg} alt="Center Image" />
      <Button />
    </div>
  );
}

function Button() {
  return (
    <div>
      <button className="main-btn">Share</button>
      <button className="main-btn">Share</button>
    </div>
  );
}
